<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Contact Us | CrocoVex</title>
    <link href="https://fonts.googleapis.com/css2?family=Orbitron:wght@400;700&family=Roboto:wght@300;400&display=swap" rel="stylesheet">
    <style>
        body {
            margin: 0;
            font-family: 'Roboto', sans-serif;
            background: linear-gradient(135deg, #1B1F38, #0F121F);
            color: #FFF;
            overflow-x: hidden;
        }

        header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding: 20px;
            background: rgba(27, 31, 56, 0.9);
            position: fixed;
            width: 100%;
            top: 0;
            z-index: 1000;
        }

        .logo {
            font-family: 'Orbitron', sans-serif;
            font-size: 1.8rem;
            color: #15ff00;
            text-shadow: 0 0 8px #32FF7E;
        }

        nav ul {
            list-style: none;
            display: flex;
            gap: 20px;
        }

        nav ul li a {
            text-decoration: none;
            color: #FFF;
            font-weight: bold;
            transition: color 0.3s;
        }

        nav ul li a:hover {
            color: #32FF7E;
        }

        .contact-container {
            padding: 80px 20px 50px 20px;
            text-align: center;
            background: #0F121F;
        }

        .contact-container h2 {
            font-family: 'Orbitron', sans-serif;
            font-size: 2.5rem;
            margin-bottom: 20px;
            color: #32FF7E;
            text-shadow: 0 0 8px #32FF7E;
        }

        .contact-container p {
            font-size: 1.2rem;
            margin-bottom: 30px;
        }

        .contact-form {
            display: flex;
            flex-direction: column;
            gap: 15px;
            max-width: 500px;
            margin: 0 auto;
            background: rgba(255, 255, 255, 0.1);
            padding: 20px;
            border-radius: 10px;
        }

        .contact-form input,
        .contact-form textarea {
            padding: 15px;
            background: rgba(255, 255, 255, 0.2);
            border: 1px solid #32FF7E;
            border-radius: 5px;
            color: #FFF;
            font-size: 1rem;
            transition: all 0.3s;
        }

        .contact-form input:focus,
        .contact-form textarea:focus {
            border-color: #32FF7E;
            outline: none;
            background: rgba(255, 255, 255, 0.3);
        }

        .contact-form button {
            padding: 15px;
            background-color: #32FF7E;
            border: none;
            color: #000;
            font-weight: bold;
            border-radius: 5px;
            cursor: pointer;
            transition: all 0.3s;
        }

        .contact-form button:hover {
            background-color: #28d16b;
        }

        .team-container {
            padding: 50px 20px;
            text-align: center;
            background: #1B1F38;
        }

        .team-container h3 {
            font-family: 'Orbitron', sans-serif;
            font-size: 2rem;
            margin-bottom: 20px;
            color: #32FF7E;
        }

        .team-container .team-member {
            display: inline-block;
            width: 250px;
            margin: 20px;
            text-align: center;
            background: rgba(255, 255, 255, 0.1);
            padding: 20px;
            border-radius: 10px;
            transition: transform 0.3s, box-shadow 0.3s;
        }

        .team-container .team-member:hover {
            transform: scale(1.05);
            box-shadow: 0 5px 15px rgba(0, 255, 0, 0.6);
        }

        .team-container .team-member img {
            width: 150px;
            height: 150px;
            border-radius: 50%;
            margin-bottom: 10px;
            border: 3px solid #32FF7E;
        }

        .youtube-section {
            padding: 50px 20px;
            text-align: center;
            background: #0F121F;
        }

        .youtube-section h4 {
            font-family: 'Orbitron', sans-serif;
            font-size: 2rem;
            margin-bottom: 20px;
            color: #32FF7E;
        }

        .youtube-video {
            max-width: 800px;
            margin: 0 auto;
            background: rgba(255, 255, 255, 0.1);
            padding: 10px;
            border-radius: 10px;
        }

        footer {
            padding: 20px;
            background: rgba(27, 31, 56, 0.9);
            text-align: center;
            color: #FFF;
            font-size: 0.9rem;
        }

        footer a {
            color: #32FF7E;
            text-decoration: none;
        }
    </style>
</head>

    <header>
        <div class="logo">CrocoVex</div>
        <nav>
            <ul>
                <li><a href="#">Home</a></li>
                <li><a href="#">About Crypto</a></li>
                <li><a href="#">Live Prices</a></li>
                <li><a href="#">Blogs</a></li>
                <li><a href="ContactUs.html">contact</a></li>
            </ul>
        </nav>
    </header>

    <section class="contact-container">
        <h2>Contact Us</h2>
        <p>Have any questions? Feel free to reach out to us!</p>
        <form class="contact-form">
            <input type="text" name="name" placeholder="Your Name" required>
            <input type="email" name="email" placeholder="Your Email" required>
            <textarea name="message" rows="5" placeholder="Your Message" required></textarea>
            <button type="submit">Send Message</button>
        </form>
    </section>
